<div id="note_writings02">ドウシシャ製 Luminous ルミナス LEDシーリングライトの本製品は、光拡散レンズを使用することにより、少ないLEDチップの数でもお部屋の隅々まで光を拡散して広げるので、お部屋の隅々まで明るく照らします。
従来品よりLEDチップが減ったことにより、消費電力は抑え、さらに省エネになりました！
LEDはスイッチのオン・オフにも強いので、明るさ調節や電気のオン・オフをこまめに行うリビングの照明にも最適です。
シンプル でスリムな薄型 LEDシーリングライト なので、インテリアのイメージを壊さず、おしゃれでスタイリッシュなお部屋を演出します。
もちろん、和室 洋室 にもぴったりマッチする LED天井照明 ですので、どんなお部屋でも雰囲気を壊さずご使用できます。

操作が簡単なリモコン付きなので、LEDの調光も簡単に変えられます。
リモコン・壁スイッチにも両方対応しているので、とても便利です。

お客様から頂くレビューでも、「想像していたよりもっと明るかった」「電気代が下がった」「取付も簡単だった」と大変ご好評頂いております。ぜひ、お部屋の電気を、蛍光灯から省エネ・長寿命なLEDライトに変えられることをオススメいたします。</div><style type="text/css">
