<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;新生活特集

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
AIRCORNO エアコルノ006 シーリングライト<br>
<br>
電球で印象が変わるシンプルなシーリングライト。<br>
梨地仕上げのシルバーはシャープでワンランク上の印象。<br>
口金はGU10、35Wの電球に対応。LED電球もお使いいただけます。<br>
<br>
【特徴】<br>
・天井用6灯スポットシーリングライト。<br>
・取付アダプタで簡単設置。<br>
・電球が見えてオシャレ。<br>
・シルバーのボディがシンプルモダン。<br>
・省エネ、長寿命なLED電球対応。<br>
・定格消費電力は最大約210W(35W×6) 。<br>
<br>
無駄のないミニマルデザインでお部屋に溶け込みやすいので、リビングだけでなく、オフィスやカフェなどにもピッタリ。<br>
取付アダプタタイプで設置は簡単。<br>
電球がほとんど見えている状態なので、電球を変えたときはまたひとつ、違った印象になります。 <br>
スポットライトタイプの6つのセードとヒンジは、330°×90°の自由な可動域で、<br>
壁に反射させたり、時計や椅子などにスポットを当てたりとお好みに合わせてお部屋をオシャレに演出します。<br>
一般的な引掛シーリング対応なのですぐにご使用いただけます。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
※電球、本体取り付け用ドライバーは付属しておりません。<br>
※調光、調色電球や、調光式の壁スイッチは故障の原因になりますのでお使いいただけません。<br>
